import "./style.css";


export default class SearchResults extends Component {
    constructor(props) {
        super(props)
        console.log("this is my initalizer");

        const movies = [
            {id: 0, title: "movie title 1", overview: "movie summary  1"},
            {id: 1, title: "movie title 2", overview: "movie summary  2"},
        ]

        this.state = { rows: [
            <p>this is row 0</p>,
            <p>this is row 1</p>,
            <p>this is row 2</p>
        ]}

        movies.forEach((movie) => {
            console.log(movie.title)
        })
    }

    render() {
        return (
